(function(){App.controller("ControlHabitacionesController",["$scope","filterFilter","$http",function(a,t,n){return a.cantidad=0,a.dias_habitaciones=[],n.get("./habitaciones_estado?cantidad="+a.cantidad).success(function(t){return a.dias_habitaciones=t}),a.avanzar_semana=function(){return a.cantidad=a.cantidad+1,n.get("./habitaciones_estado?cantidad="+a.cantidad).success(function(t){return a.dias_habitaciones=t})},a.retroceder_semana=function(){return a.cantidad=a.cantidad-1,n.get("./habitaciones_estado?cantidad="+a.cantidad).success(function(t){return a.dias_habitaciones=t})},a.set_class=function(a){return a?"libre":"ocupada"},a.obtener_datos=function(){return n.get("./habitaciones_estado?cantidad="+a.cantidad).success(function(t){return a.dias_habitaciones=t})}}])}).call(this);